import React from 'react';
import './Dashboard.css'; // Ensure this file exists with the appropriate styles

const Dashboard = () => {
  return (
    <div className="dashboard">
      <h1 className="dashboard-title">OVERVIEW</h1>
      <section className="priority-tasks">
        <h2>PRIORITY TASKS</h2>
        {/* Components for priority tasks will go here */}
      </section>
      <div className="dashboard-lower">
        <section className="task-analytics">
          <h2>TASK ANALYTICS</h2>
          {/* Components for task analytics will go here */}
        </section>
        <section className="calendar-section">
          <h2>CALENDAR</h2>
          {/* Calendar component will go here */}
        </section>
      </div>
      <div className="view-reports">
        <button>View reports here</button>
      </div>
    </div>
  );
};

export default Dashboard;
